Defendant Keith T Johnson in court with attorney Adam J. Schleis.  David John Behm appeared for the State of Wisconsin.  State moves to amend Count 1 and files amended Information.  Court accepts.  Defendant enters a guilty plea to Counts 1, 2 and 3 of the Amended Information.  Court finds defendant guilty.  The Defendant was given the following:

COUNT 1:

WITHHELD SENTENCE

TERM OF PROBATION:  1 YEAR CONCURRENT

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;

COURT COSTS:  $243.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

Credit - none


